r.r;\n    color.g = S * weight + (1.0 - weight) * color.g;\n    color.b = L * weight + (1.0 - weight) * color.b;\n\n    return hslToRGB(color);\n}\n\nfloat brightnessAndContrast(float color) {\n    return (color - 0.5) * u_contrast + 0.5 + u_brightness;\n}\n\nvec4 applyBrightnessAndContrast(vec4 color, float weight) {\n    color.r = brightnessAndContrast(color.r) * weight + (1.0 - weight) * color.r;\n    color.g = brightnessAndContrast(color.g) * weight + (1.0 - weight) * color.g;\n    color.b = brightnessAndContrast(color.b) * weight + (1.0 - weight) * color.b;\n\n    return color;\n}\n\nvec4 applyGamma(vec4 color, float weight) {\n    color.r = pow(color.r, u_gamma) * weight + (1.0 - weight) * color.r;\n    color.g = pow(color.g, u_gamma) * weight + (1.0 - weight) * color.g;\n    color.b = pow(color.b, u_gamma) * weight + (1.0 - weight) * color.b;\n\n    return color;\n}\n\nvec4 saturate(vec4 color) {\n    color = applyHSLShift(color, u_hslWeight);\n    color = applyBrightnessAndContrast(color, u_brightnessAndContrastWeight);\n    color = applyGamma(color, u_gammaWeight);\n    return color;\n}\n\n#endif\n\n#ifdef FOG\nuniform vec3 u_fog;\nuniform float u_fogDistance;\n#endif\n\n#ifdef SHADOW\nuniform vec3 u_shadowTint;\n#endif\n\n#ifdef DETAIL\nuniform sampler2D u_textureDetail;\nuniform float u_textureDetailDensity;\n#endif\n\n#ifdef METALLIC\nuniform samplerCube u_texture_cube;\nuniform vec3 u_view_pos;\nvarying vec4 v_pos;\n#endif\n\n#ifdef CUTOUT\nuniform float u_cutout;\n#endif\n\n#ifdef DITHER\nfloat dither(vec4 pos) {\n    float x = floor(mod(pos.x, 2.0));\n    float y = floor(mod(pos.y, 2.0));\n    float x_ = x * 2.0;\n    return y * (3.0 - x_) + (1.0 - y) * x_;\n}\n#endif\n\n#ifdef GREYSCALE\nuniform float u_greyscale;\n\nvec4 toGreyScale(vec4 color) {\n    float greyscaleValue = 0.2126 * color.r + 0.7152 * color.g + 0.0722 * color.b;\n    \n    color.r = greyscaleValue * u_greyscale + (1.0 - u_greyscale) * color.r;\n    color.g = greyscaleValue * u_greys
